import React from 'react';

const WorkoutItem = ({ workout }) => {
  return (
    <div className="workout-item">
      <h3>{workout.title}</h3>
      <p><strong>Load:</strong> {workout.load} KG</p>
      <p><strong>Reps:</strong> {workout.reps}</p>
    </div>
  );
};

export default WorkoutItem;
